import React, { Component } from 'react';
import { Input, Label, Icon } from 'semantic-ui-react';
require('../Team.css');

const TeamMember = props => {
  const colors = [
    'blue',
    'teal',
    'olive',
    'green',
    'yellow',
    'orange',
    'pink',
    'violet',
    'red',
    'purple',
    'grey',
    'black'
  ];

  return (
    <div className="TeamMember">
      <Label as="a" color={colors[props.index]} image>
        <img src={profilePictures[props.index]} alt="" />
        {props.member.name}
        <Label.Detail>{props.member.role}</Label.Detail>
        <Icon name="delete" className="btnClose" />
      </Label>

      <div>
        <label>Days </label>
        <Input
          className="AvailabilityInput"
          transparent
          placeholder="10"
          size="small"
        />
        <br />
        <label>Hours</label>
        <Input
          className="AvailabilityInput"
          transparent
          placeholder="8"
          size="small"
        />
      </div>
    </div>
  );
};

const TeamMembers = () => {
  const users = [
    {
      name: 'Amir',
      role: 'SE'
    },
    {
      name: 'Mariane',
      role: 'SE'
    },
    {
      name: 'Dion',
      role: 'SE'
    },
    {
      name: 'Amit',
      role: 'HUX'
    },
    {
      name: 'Masoud',
      role: 'jakesh'
    }
  ];

  return users.map((member, index) => (
    <TeamMember key={index} member={member} index={index} />
  ));
};

class TeamMembersList extends Component {
  render() {
    return (
      <div>
        <TeamMembers />
      </div>
    );
  }
}

export default TeamMembersList;

